]
//

const Cart = ()=>(

    <div class="cartdiv">
        <img id="cartimg" src={cartimg} alt="cartIMG" />
        <div class="shopinglist">
        {Product.map((product) => (
        <div id="product">
            <ul>
                <li>
                <img id="productimg"src={cartimg} alt="product Image" />
